import React from 'react';
import Container from '@mui/material/Container';

import Card from './Card.js';

const style = {
  display: 'flex',
  width: '100%',
  height: '35vh',
  background: '#0009'
}

const defaultData = [null, null, null, null, null, null, null];

const Bar = (props) => {

  const cards = props.selected !== null
    ? ""
    : defaultData.map((value, key) => (
      <Card key={key} data={value} />
    ))

  return (
    <Container style={style}>
      {cards}
    </Container>
  )
}

export default Bar
